import React, { Component, Fragment} from 'react'

import Drawer from '@material-ui/core/Drawer'
import Fab from '@material-ui/core/Fab'
import MenuIcon from '@material-ui/icons/Menu'

class loading extends Component {
  constructor(props) {
    super(props)
    this.state = { 
      drawerIsOpen:false,
    }
  }

  render() {

    return (
      <div>
        <Fab disabled aria-label="like" onClick={this.setState({drawerIsOpen:true})} style={{position:"fixed", top:"15px", right:"15px"}}>
          <MenuIcon />
        </Fab>
        <Drawer anchor='right' open={this.state.drawerIsOpen} onClose={this.setState({drawerIsOpen:false})}>
          :)
        </Drawer>

        {this.props.children}

      </div>
    )
  }
}

export default loading;
